	 ('False',NULL,0,'[{"id": 18, "name": "Drama"}]',NULL,65283,'tt0046149','en','Les Orgueilleux','The first to die in an epidemic of meningitis in Vera Cruz is a French tourist. His wife Nellie, detached and indifferent, feels little grief and realizes that her coldness is her own doom. Over the next two days, she is attracted to George, a local drunk who does odd jobs for brothels and dances grotesquely for tourists in exchange for drinks. George has his own dark secret, a tragedy he caused that leaves him with a death wish. In assisting the local doctor to cope with the epidemic, these two emotional cripples enable each other to rediscover reasons to live and to love.','[-0.011855436,0.0041014324,0.011519646,-0.025986018,0.009785874,0.020407796,-0.008058955,0.010409484,0.0055576637,-0.021312373,-0.015405213,0.05183498,-0.008641448,0.021024553,0.012561279,0.010361514,0.04912125,0.010731568,0.039911017,-0.020188505,0.0005713566,0.013095802,0.027246943,-0.0061264504,-0.0028250886,0.007380523,-0.00084846886,-0.0095117595,0.019530632,-0.015062571,0.011204415,-0.0076135197,-0.0014947786,-0.022134716,-0.035634834,-0.018488998,0.010663039,-0.023450462,0.007976721,-0.002588665,0.013150625,-0.0012549286,-0.009593994,0.002049003,-0.0077711353,0.018393056,-0.00790134,-0.020339267,-0.022354007,-0.0029552928,0.024930678,-0.0029295946,-0.022079892,0.008141189,-0.012184372,-0.02298447,0.006410844,-0.0052115945,-0.007586108,-0.010827508,0.003503521,-0.010806949,-0.018393056,-0.014240229,-0.008668859,-0.0023505285,-0.02039409,-0.009929784,0.0038513034,0.03201653,0.050354764,0.017995592,0.006273787,0.0034829625,0.021230139,-0.016460553,-0.03881456,0.010573952,0.0017389115,0.0063697267,0.01863976,-0.022628121,-0.0119376695,0.027644409,0.022299184,-0.007791694,-0.0027514205,0.024683977,-0.0021963394,-0.0148432795,0.003751937,0.03708764,-0.0048483936,0.0008874445,0.0066643995,-0.00020762003,0.009552877,0.011540204,0.005355505,-0.027233237,-0.02524591,0.006972778,-0.020380385,-0.01360291