	 ('False',NULL,0,'[{"id": 16, "name": "Animation"}, {"id": 18, "name": "Drama"}]',NULL,73714,'tt1118665','ja','カフカ 田舎医者','A hapless country doctor describes with breathless urgency a night-time summons to attend a young patient. Events soon take on a surreal aspect as "unearthly horses" transport him instantaneously to the bedside. The doctor, preoccupied with personal distractions and grievances against those he is employed to care for, fails to find what is revealed to be a vile, fatal wound. He is humiliated by the villagers, who are "always expecting the impossible from the doctor," and doomed to an endless return trip, losing everything.','[-0.0041866275,-0.0002545806,0.012501496,-0.0099119,0.007301698,0.017419666,-0.019466614,-0.030195922,-0.01385468,-0.006271355,-0.0049456465,0.015207863,-0.005021205,-0.005192929,0.02095031,0.011526104,0.043411788,-0.02298352,0.008400731,-0.032339033,-0.016251944,-0.0021362447,-0.0077069663,0.01667782,0.0006890419,0.0112994285,0.0074802907,-0.023890221,0.003918738,-0.020538172,-0.00787869,-0.022021865,-0.0054848595,-0.023560511,-0.022695024,0.007439077,0.016183255,-0.01877972,0.0058317417,-0.0042587514,0.022695024,0.00068088504,-0.0041282414,-0.0052547497,-0.009657749,0.008290827,0.029893687,-0.029563976,-0.020167248,0.0147270365,0.025717363,0.0078855585,-0.0053955633,-0.021568514,0.02704994,0.013428804,0.0035100353,0.013236474,0.004911302,-0.016554179,-0.008751047,-0.02397265,-0.014383589,0.0016021834,-0.015839808,0.00017870012,-0.032916028,0.0002236703,-0.008751047,-0.0056428458,0.035498753,0.0053131357,0.003990862,-0.013840942,0.034454674,-0.026211927,-0.022832403,0.0031665878,0.0009796845,0.014520968,0.008187793,-0.025222799,-0.020373316,0.040856536,0.011464284,-0.012941109,-0.0027716227,0.021513563,-0.0066594505,-0.012899895,0.003204367,0.023395656,0.014740774,0.016595392,0.005265053,-0.009245612,-0.014452279,0.033053406,0.016444275,-0.038823325,-0.01904074,0.018024135,-0.019988656,-0.012103097,-0.0023612028,0.001146256