	 ('False',NULL,0,'[]',NULL,105419,'tt0079007','en','El crimen de Cuenca','In 1913, Gregorio Valero Contreras and León Sánchez Gascón, friends and neighbors of Osa de la Vega (Cuenca) are arrested as perpetrators of the death of José María Grimaldos López, shepherd and former teammate. The village accuses them and even Gregorio''s wife gathers evidence against them. The two men confess the crime after being tortured. They are judged in 1918 in the Provincial Court of Cuenca and, after modifying the request for capital punishment, they are condemned to eighteen years in prison ...','[0.0061066328,0.008772334,0.004352166,-0.04126397,-0.019883959,0.023311289,-0.015763002,0.0003831521,-0.006592851,-0.042814434,-0.00014333671,0.022359252,-0.004620776,-0.015531792,-0.009017143,0.0135053145,0.03122679,0.007582289,0.00972437,0.00031408697,-0.0063038403,0.0042331615,-0.027065031,-0.00944556,0.004219561,0.016347824,-0.004800983,-0.023569698,0.023719303,-0.01728626,-0.0028850099,-0.00094098586,0.0027371044,0.006344642,-0.04596975,-0.031335596,0.0042603626,-0.0073850816,-0.0075414875,0.020781592,0.014729361,-0.0029683132,-0.011696446,-0.03517094,-0.014470952,-0.0157358,0.006902263,-0.031662006,-0.016334223,0.026711417,0.03043796,0.018251896,-0.03119959,-0.008520725,0.02702423,-0.0073578805,0.00655205,-0.0017731676,0.004331765,-0.007976704,-0.0076910933,-0.026126595,-0.0034800326,0.005831222,-0.007215075,-0.0006528249,-0.014008534,0.01521898,-0.007051869,0.002155682,0.03514374,0.015504591,-0.0009783873,-0.0128592905,0.034028497,-0.016891845,-0.023719303,-0.029023506,0.00065665005,-0.0028731094,0.012152063,-0.019054325,0.00051044446,0.015545392,-0.011852852,-0.019747952,0.002832308,0.010533601,-0.004335165,-0.015191779,0.004484771,0.03854387,0.011519639,0.00048664355,-0.02994834,-0.005906025,-0.017463066,0.014117338,0.008751933,-0.0031978218,-0.011614842,-0.0033865292,-0.0153685855,-0.018836718,-0.029839538,-0.028533887,0.013756924,0.007840699,0.0034273306,-0.013260505,-0.0059366